content:
&lt;추측&gt;
1.해웅이는 비관적 과거를 회상. 부정적 방어적 태도를 취하며 스트레스 받음
2.더만이한테 계속 털리다보니, 자신의 무기(테니스스타일)가 평범함에 뿌리를 두었다는걸.
   이 무기를 만렙으로 올려봤자 그 뿌리는 평범함에 있다는걸 인정b
3.결국 해웅이는 시합중 처음or 살면서 처음 자신의 본질중 일부분을 인정한거.
   해웅이 과거 경험과 사건이 스타일에 물들었다고 했으니 &lt; 무기의 본질=자신의 본질 ㅇㅋ? &gt;

아..머리에 피도 안마른 것들이 어른을 놀리는 다음이 궁금해서 결제노예가 잠깐 되어버렸는데..
강해웅과 비더만의...미래의 강산과 주신이의 시합?이야기만 하다가 2부가 끝날거 같네요..-_-;;
주신이 테니스 다시 하겠죠?  강산이가 뭔가 어설프지만 진정성있는 말을 할거 같은데..

주신이 고니랑 내기 테니스를 치다가 챌린지를 함 . 
&quot;동작그만, 사기 콜이냐? 내가 여기서 빽핸드 크로스를 날리면 니가 다시 빽핸드 크로스 코트를 날린 것이여. 내가 여기서 드랍샷을 날린걸 발리로 받았쟤. 그 다음에 내가 패싱을 했는데 공 나갔다고 해서 경기를 끝내겠다는거 아니여&quot;
&quot;시나리오 쓰고있네 ㅁㅊㅅㄲ가?&quot;
&quot;클레이코트 선에 공자국이 찍혀있을것이여, 선 건들지마. 손모가지 나가붕게&quot;
&quot;좋아.이 공이 아웃이라는데 내 손모가지를 건다&quot;
&quot;아웃이네?&quot;
&quot;확실하지 않으면 챌린지 걸지마라 안배웠어? 뭐해 손목안찍고?&quot;
&quot;으아아악

근데 쟨 벼ㅡㅇ신인가?... 계속 다 보인다고하는데 이제까지 계속 똑같은패턴으로 이기려고햇던거야?ㅋㅋㅋㅋㅋ과정이 너무 오바치는데
10세트넘게 지는데 똑같은 방식으로 하면 그냥 상대방은 뭐가 올지 아니까 막을수잇잖아 ㅋㅋㅋㅋ
한번도 안바꾼거네 ㄹㅇ...;

물도깨비가 욕심내는거라기보단..
불도깨랑 영감(물도깨비)이랑 친한데 
1화부터 보면 불도깨비를 다시 도깨비 되게 하려고 하잖아요 ;
그 단서가 부훈장이 남긴 나뭇잎으로 만든 종이인데 
부훈장 물건을 찾아야 볼 수 있으니깐 열심히 찾는거 아닐까요 &#x27;&#x27;
